import React from "react";
import "./App.css";
import { useQuery } from "react-query";
import apiClient from "./api/apiClient";

function App() {
  const { data, isLoading } = useQuery("getUser", async () => {
    const { data } = await apiClient.get(`/users`);
    console.log(data);
    return data;
  });

  return (
    <div className="App">
      {isLoading ? (
        "loading..."
      ) : (
        <ul>
          {data.map(
            (d: { Id: number; FirstName: string; LastName: string }) => {
              return (
                <li key={d.Id}>
                  {d.Id}, {d.FirstName}, {d.LastName}
                </li>
              );
            }
          )}
        </ul>
      )}
      <h1>Hello</h1>
    </div>
  );
}

export default App;
